import { Link } from 'react-router-dom';
import ArtistsCard from "./ArtistsCard";


export const artist_information = [
    {
        name: "Travis Scott",
        id: 1,
        birth: "May 1",
        country: "America",
        popularity: 12,
        genre: "Hip Hop",
        albums : ["astro world" ,"MBDTF"],
        futureEvents: ["Austin,TX", "Dallas, TX", "NYC, NY"],
        image_url : "www"

    },
    {
        name: "Tony Stark",
        id: 2,
        birth: "May 51",
        country: "USA",
        popularity: 1,
        genre: "Rap",
        albums : ["mark1" ,"mark2","mark3","mark4","mark5"],
        futureEvents: ["Austin,TX", "NewJeresy, TX", "NYC, NY", "Deep ,Sea"],
        image_url : "www"
    },
    {
        name: "John Doe",
        id: 3,
        birth: "Aug 12",
        country: "Europe",
        popularity: 99,
        genre: "Pop",
        albums : ["Pork" ,"Man Man"],
        futureEvents: ["George,TX", "Dallas, TX", "NYC, NY"],
        image_url : "www"
    },
    {
        name: "First last",
        genre: "Example genre",
        futureEvents: []
    }
    ,
    {
        name: "First last",
        genre: "Example genre",
        futureEvents: []
    }
    ,
    {
        name: "First last",
        genre: "Example genre",
        futureEvents: []
    }

]

function Artists(props) {
    return (
        <>

            <div class="row g-5 m-2" >
                <h1>Artists</h1>
                {
                    artist_information.map((artist) => (
                        <div id={artist.id} class="col-xl-3 h-25" key={artist.id}>
                            <ArtistsCard ArtistsName={artist.name} Genre={artist.genre} />
                        </div>
                    ))
                }
            </div>
        </>
        // <div>
        //     <h2>Artists</h2>
        //     <p>Travis Scott, R Kelly, Taylor Swift, and More!!</p>
        // </div>
    );
}

export default Artists;
